import React, { Component } from 'react';
import { bindActionCreators } from 'redux';
import { connect } from "react-redux";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import * as userActions from './actions/userActions';
import './App.css';
import Header from './Component/Header';
import Footer from './Component/Footer';
import Home from './Component/Pages/Home';
import Packages from './Component/Pages/Packages';
import Docter_file from './Component/Pages/Docter_file';
import Homecardic from './Component/Homecrdic/Homcardic';
import Homecardicepage from './Component/Pages/Homecardicepage';
import Index2 from './Component/Pages/Index2';
import Index3 from './Component/Pages/Index3';
import Index4 from './Component/Pages/Index4';
import Index5 from './Component/Pages/Index5';
class App extends Component {
  render() {
    return (
      <Router> 
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path='/packges' component={<Packages/>}/>
          <Route path='/Docter_file' component={<Docter_file/>}/>
          <Route path='/Homecardic' component={<Homecardicepage/>}/>
          <Route path='/Index2' component={<Index2/>}/>
          <Route path='/Index3' component={<Index3/>}/>
          <Route path='/Index4' component={<Index4/>}/>
          <Route path='/Index5' component={<Index5/>}/>
        </Switch>
      </Router>
    );
  }
}
const mapStateToProps = (state /*, ownProps*/) => {
  return {
    user: state.user,
  };
};

const mapDispatchToProps = dispatch => {
  return {
    actions: bindActionCreators(userActions, dispatch),
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(App);
